import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';

const String = '127.0.0.1';

function Product() {
  const { name } = useParams(); 
  const [product, setProduct] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    if (!name) {
      console.error('Отсутствует параметр имени продукта');
      return;
    }

    fetch('http://' + String + ':8000/api/goods/' + name)
      .then((response) => {
        if (!response.ok) {
          throw new Error('Товар не найден');
        }
        return response.json();
      })
      .then((data) => {
        setProduct(data); 
      })
      .catch((error) => {
        console.error('Ошибка при загрузке товара:', error);
        alert('Товар не найден. Попробуйте еще раз.');
      });
  }, [name]); 
  console.log(name)
  const handleAddToCart = () => {
    console.log(`Товар ${product.name} добавлен в корзину!`);
  };

  return product ? (
    <div class="container">
            <div class="row mt-1">
                <div class="col-lg-10">
                    {/* Контент на странице --> */}
                    <div class="container mt-5">
                        <div class="card mb-4 custom-shadow">
                            <div class="row">
                                {/*  Миниатюры */}
                                <div class="col-md-4">
                                    <img src={`http://${String}:8000${product.image}`}
                                        class="img-thumbnail" data-bs-toggle="modal" data-bs-target="#imageModal1" />
                                </div>
                                {/* Увеличить изображение в модальном окне */}
                                <div class="modal fade" id="imageModal1" tabindex="-1"
                                    aria-labelledby="imageModal1Label" aria-hidden="true">
                                    <div class="modal-dialog modal-lg">
                                        <div class="modal-content">
                                            <div class="modal-header">
                                                <h5 class="modal-title" id="imageModal1Label">Изображение 1</h5>
                                                <button type="button" class="btn-close" data-bs-dismiss="modal"
                                                    aria-label="Закрыть"></button>
                                            </div>
                                            <div class="modal-body">
                                                <img src={`http://${String}:8000${product.image}`}
                                                    class="img-fluid" alt="Изображение 1" />
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            {/* Описание товара */}
                            <div class="card-body">
                            <h2>{product.name}</h2>
                            <p><strong>Описание:</strong> {product.description}</p>
                            <p><strong>Цена:</strong> {product.price} BYN</p>
                                <a href="#" class="btn btn-dark add-to-cart">Добавить в корзину</a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
    {/* <div className="container">
      <div className="row mt-5">
        <div className="col-md-6">
          <img
            src={`http://${String}:8000${product.image}`}
            alt={product.name}
            className="img-fluid"
            style={{ objectFit: 'contain' }}
          />
        </div>
        <div className="col-md-6">
          <h2>{product.name}</h2>
          <p><strong>Описание:</strong> {product.description}</p>
          <p><strong>Цена:</strong> {product.price} BYN</p>
          <button className="btn btn-primary" onClick={handleAddToCart}>
            Добавить в корзину
          </button>
          <button className="btn btn-secondary ml-3" onClick={() => navigate(-1)}>
            Назад
          </button>
        </div>
      </div> */}
    </div>
  ) : (
    <div className="container text-center">
      <div style={{ padding: '35px', borderRadius: '15px' }}></div>
      <div className="spinner-border" role="status">
        <span className="visually-hidden">Загрузка...</span>
      </div>
    </div>
  );
}

export default Product;
